public class InnerRuleTargetFactory(Action<Humidifier.Events.RuleTypes.Target> factoryAction = null) : SubResourceFactory<Humidifier.Events.RuleTypes.Target>
{

    internal InnerRuleHttpParametersFactory HttpParametersFactory { get; set; }

    internal InnerRuleDeadLetterConfigFactory DeadLetterConfigFactory { get; set; }

    internal InnerRuleRunCommandParametersFactory RunCommandParametersFactory { get; set; }

    internal InnerRuleInputTransformerFactory InputTransformerFactory { get; set; }

    internal InnerRuleKinesisParametersFactory KinesisParametersFactory { get; set; }

    internal InnerRuleRedshiftDataParametersFactory RedshiftDataParametersFactory { get; set; }

    internal InnerRuleAppSyncParametersFactory AppSyncParametersFactory { get; set; }

    internal InnerRuleSqsParametersFactory SqsParametersFactory { get; set; }

    internal InnerRuleEcsParametersFactory EcsParametersFactory { get; set; }

    internal InnerRuleBatchParametersFactory BatchParametersFactory { get; set; }

    internal InnerRuleSageMakerPipelineParametersFactory SageMakerPipelineParametersFactory { get; set; }

    internal InnerRuleRetryPolicyFactory RetryPolicyFactory { get; set; }

    protected override Humidifier.Events.RuleTypes.Target Create()
    {
        var targetResult = CreateTarget();
        factoryAction?.Invoke(targetResult);

        return targetResult;
    }

    private Humidifier.Events.RuleTypes.Target CreateTarget()
    {
        var targetResult = new Humidifier.Events.RuleTypes.Target();

        return targetResult;
    }
    public override void CreateChildren(Humidifier.Events.RuleTypes.Target result)
    {
        base.CreateChildren(result);

        result.HttpParameters ??= HttpParametersFactory?.Build();
        result.DeadLetterConfig ??= DeadLetterConfigFactory?.Build();
        result.RunCommandParameters ??= RunCommandParametersFactory?.Build();
        result.InputTransformer ??= InputTransformerFactory?.Build();
        result.KinesisParameters ??= KinesisParametersFactory?.Build();
        result.RedshiftDataParameters ??= RedshiftDataParametersFactory?.Build();
        result.AppSyncParameters ??= AppSyncParametersFactory?.Build();
        result.SqsParameters ??= SqsParametersFactory?.Build();
        result.EcsParameters ??= EcsParametersFactory?.Build();
        result.BatchParameters ??= BatchParametersFactory?.Build();
        result.SageMakerPipelineParameters ??= SageMakerPipelineParametersFactory?.Build();
        result.RetryPolicy ??= RetryPolicyFactory?.Build();
    }

} // End Of Class

